import { Component } from '@angular/core';
import {MatIconModule} from '@angular/material/icon';
import {MatButtonModule} from '@angular/material/button';
import {MatToolbarModule} from '@angular/material/toolbar';
import {MatTabsModule} from '@angular/material/tabs';

import {MatDividerModule} from '@angular/material/divider';


@Component({
  selector: 'app-toolbar',
  templateUrl: './toolbar.component.html',
  styleUrls: ['./toolbar.component.css'],
  standalone: true,
  imports: [MatIconModule, MatButtonModule, MatToolbarModule, MatTabsModule, MatDividerModule]
})
export class ToolbarComponent {

  onClick(){
    alert("Se apreto el boton");
  }
}

<p>
    <mat-toolbar color="primary">
      <button mat-icon-button class="example-icon" aria-label="Example icon-button with menu icon">
        <mat-icon>menu</mat-icon>
      </button>
      <span>My App</span>

      <button mat-raised-button color="primary" (click)="onClick()">Products</button>
      <button mat-raised-button color="primary" (click)="onClick()">Cart</button>
      <button mat-raised-button color="primary" (click)="onClick()">User</button>
    </mat-toolbar>
  </p>
